import React, {Component} from 'react'

class RecepieCard extends Component{
	render(){
		const {title} = this.props.title;
		return(
			<div>
				<h2>{title}</h2>
				<ul>
					<li>{this.props.ingredients}</li>
				</ul>
			</div>
		);
	}
}

export default RecepieCard;
